# -*- coding: GBK -*-

# 将ico文件写到指定路径（不覆盖）。

import os;
import base64;
import gzip;
import StringIO;

def create(path):
    if not os.path.exists(path):
        gzip_b64 = "";
        
        output = StringIO.StringIO();
        output.write(base64.b64decode(gzip_b64));
        output.seek(0);
        
        g = gzip.GzipFile(mode = "rb", fileobj = output);
        content = g.read();
        g.close();
        
        output.close();
        
        fo = open(path, "wb");
        fo.write(content);
        fo.close();
